  [1711906]="陈淑芬，画家，与丈夫平凡合称“平凡淑芬”。90年代就成名于台湾、香港、日本等多个地区。为许多经典武侠游戏，如《笑傲江湖》《仙剑奇侠传三》绘制了立绘和宣传图。他们的画风誉满中国乃至全亚洲。因对《梦江湖》心生喜爱，进入《梦江湖》世界中成为一名角色。",
