  [1711957]="纹银，游戏美术界最酷女画师，著名插画师、概念艺术家。2018、2019 GGAC全球游戏美术概念大赛原画组评审。参与过《轩辕传奇》、《刀锋铁骑》、《Legend of the Cryptids》、《风云二》、《天谕》等项目，并出版有个人画集《镜花水月》、《浮光掠影》。因对《梦江湖》心生喜爱，进入《梦江湖》世界中成为一名角色。",
